import MeetUpForm from "./MeetupForm";
import groupImage from "./group-img.jpg";


const Body = () => {
  return (
    <div className="flex flex-row max-container pt-13 ">
      <img className="" src={groupImage} alt="event" height={300} width={500}></img>
      <MeetUpForm />
    </div>
  );
};

export default Body;
